        //                 const item1 = this.cities[j];
        //                 if (item1[0] === item[2]) {
        //                     str = item1[1] + ' ' + str;
        //                     for (let k = 0; k < this.cityData.length; k++) {
        //                         const item2 = this.cityData[k];
        //                         if (item1[2] === item2.value) {
